import React, {Fragment} from "react";

function Advertencia(score) {
    if (score > 30){
      return (
        <Fragment>
        <div>
        <p>Advertencia: Tienes los s√≠ntomas.</p>
        <input type="radio" className="radio" name="progress" value="seventyfive" id="seventyfive"> </input>
        <label for="seventyfive" class="label">75%</label>
        <div className="progress">
            <div class="progress-bar"></div>
        </div>
        </div>
        </Fragment>
      );
    } else {
      return(
        <Fragment>
        <div>
        <input type="radio" className="radio" name="progress" value="five" id="five"></input>
        <label for="five" className="label">5%</label>
        </div>
        </Fragment>
      );
    }
}

const Alertbar = ({score}) => {
    return(
        Advertencia(score)
    );
};

export default Alertbar;
